import styles from "../styles/Method.module.css";
import designprocess from "../assets/designprocess.png";
import designsprint from "../assets/designsprint.png";

function Oandalive() {
    return (
        <section className={styles.method}>
            <h1>Design Method</h1>
                <img src={designprocess} className={styles.methodImg} alt="OANDA metrics" />


            <h2>Design Sprints</h2>

            <p>
                One of the key things I enjoy when being a part of a team is doing Design Sprints together. As a manager, we held Design Sprints every Tuesday that anybody in the company can join. The process and days are detailed below
            </p>
            <h3>Building A Team</h3>
                    <p>At OANDA, I built a design team from the ground up. What I looked for and my role as a manager included:</p>
                    <ul>
                        <li>• Finding people who were eagern to learn, grow and adapt.</li>
                        <li>• Helping grow their skills by organizing design sprints, brainstorm sessions, team events.</li>
                        <li>• Weekly 1-1s</li>
                        <li>• Performance reviews twice a year.</li>
                    </ul>
            <img src={designsprint} className={styles.methodImg} alt="OANDA metrics" />

        </section>
    );
}

export default Oandalive;
